pragma solidity ^0.8.16;
contract MarkStorage {
    // Struct to represent a mark
    struct Mark {
        address studentAddress; // Address of the student who submitted the mark
        uint256 markValue; // The actual mark value
    }

    // Array to store marks
    Mark[] public marks;

    // Function to submit a mark
    function submitMark(uint256 _markValue) public {
        // Ensure mark value is within valid range (for simplicity, let's assume between 0 and 100)
        require(_markValue >= 0 && _markValue <= 100, "Invalid mark value");

        // Store the mark along with the sender's address
        marks.push(Mark(msg.sender, _markValue));
    }

    // Function to get the total number of marks stored
    function getMarksCount() public view returns (uint256) {
        return marks.length;
    }

    // Function to get a specific mark by index
    function getMark(uint256 index) public view returns (address, uint256) {
        require(index < marks.length, "Index out of bounds");
        return (marks[index].studentAddress, marks[index].markValue);
    }
}
